import React from "react";
import Navbar from "../Components/Navbar";
import PageBanner from "../Components/PageBanner";
import Footer from "../Components/Footer";
const Contact = () => {
  return (
    <>
      <Navbar />
      <PageBanner title="Contact" />
      <Footer />
    </>
  );
};

export default Contact;
